  \"2016-04-19T02:28:57.261339\",\n\t\"name\": \"watershed-reach-index-and-problem-scores\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Environmental Integrity Index (EII)
  is a tool developed by the City of Austinu2019s Environmental Resource Management
  Division to monitor and assess the ecological integrity and the degree of impairment
  in Austinu2019s watersheds.  This feature class provides the most recent results
  from the EII for the City of Austin Watershed Protection Departmentu2019s Masterplanning
  process.  Similarly, the Austin Lakes Index was designed to provide a yearly assessment
  of the ecological integrity of Lake Austin, Lady Bird Lake, and Lake Long.rnrnIndex
  scores (from both the EII and ALI) are an integer between 0 and 100.  Excellent
  \ 88-100 | Very Good 76-87 | Good 63-75 | Fair 51-62 | Marginal38-50 | Poor 26-37
  | Bad 13-25 | Very Bad 0-12.rnrnProblem Scores are an integer between 1 and 100
  with 1 being \"No Problem\" and 100 being a highest priority.rnrnEII Methodology:rnrnhttp://www.austintexas.gov/watershed_protection/publications/document.cfm?id=186267rnrnMaster
  Plan Problem Score Methodology:rnrnhttp://www.austintexas.gov/watershed_protection/publications/document.cfm?id=186352rnrnLake
  Index Methodology:rnrnhttp://www.austintexas.gov/watershed_protection/publications/document.cfm?id=196479\",\n\t\"license_title\":
